const ParkingDetail = (props) => {
    console.log(props);
    return (
        <div className="m-2">
        {/* Display the article details if article is not None */} 
              <div key= {props[0].id}>
                <h2 className="text-primary"> { props[0].id} </h2>
                <p> { props[0].entry } </p>
                <p> { props[0].depart } </p>
    	        <hr/>
              </div>
        </div>
        )
}

export default ParkingDetail;
